import{config}from"./recorder.js";export{millisToMinutesAndSeconds,computeTimeBetweenTwoFrames,logger,changeMainDivSize};function millisToMinutesAndSeconds(e){var i=Math.floor(e/6e4),n=(e%6e4/1e3).toFixed(0);return i+":"+(n<10?"0":"")+n}function computeTimeBetweenTwoFrames(e,i){return logger("Recording time is event[last] - event[0] = "+(e.timestamp-i.timestamp)),logger("Aka "+millisToMinutesAndSeconds(e.timestamp-i.timestamp)+" mn and secs"),millisToMinutesAndSeconds(e.timestamp-i.timestamp)}function changeMainDivSize(e,i){mainDivWidth+=e,mainDivHeight+=i,mainDiv.style.width=mainDivWidth+"px",mainDiv.style.height=mainDivHeight+"px"}function logger(e){config.debug&&console.log("generic-rrweb-recorder: "+e)}